INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 100, 10142, "エリコ", "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", 7, 24, 100, 1, 0.0, 10.85, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 101, 10142, "エリコ", "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", 2, 24, 101, 1, 0.0, 11.15, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 102, 10142, "エリコ", "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", 5, 24, 102, 7, 0.0, 6.4, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 103, 10142, "エリコ", "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", 3, 24, 103, 3, 0.0, 0.0, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 104, 10142, "エリコ", "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", 8, 24, 104, 2, 0.0, 2.43, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 105, 10142, "エリコ", "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", 3, 24, 105, 4, 0.0, 9.08, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 106, 10142, "エリコ", "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", 6, 24, 106, 6, 0.0, 0.0, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 107, 10142, "エリコ", "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", 8, 24, 107, 3, 0.0, 10.6, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 108, 10142, "エリコ", "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", 4, 24, 108, 6, 0.0, 7.54, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 109, 10142, "エリコ", "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", 7, 24, 109, 2, 0.0, 11.5, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 110, 10142, "エリコ", "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", 1, 24, 110, 2, 0.0, 8.83, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 111, 10142, "エリコ", "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", 2, 24, 111, 1, 0.0, 6.68, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 112, 10142, "エリコ", "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", 2, 24, 112, 6, 0.0, 8.8, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 113, 10142, "エリコ", "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", 1, 24, 113, 2, 0.0, 8.9, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129901, 0.0, 114, 10142, "エリコ", "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", 5, 24, 114, 2, 0.0, 3.7, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 200, 10142, "マコト", "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", 2, 24, 200, 1, 0.0, 7.6, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 201, 10142, "マコト", "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", 1, 24, 201, 2, 0.0, 2.25, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 202, 10142, "マコト", "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", 1, 24, 202, 2, 0.0, 3.28, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 203, 10142, "マコト", "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", 1, 24, 203, 4, 0.0, 2.98, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 204, 10142, "マコト", "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", 1, 24, 204, 4, 0.0, 3.0, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 205, 10142, "マコト", "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", 2, 24, 205, 1, 0.0, 10.3, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 206, 10142, "マコト", "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", 1, 24, 206, 6, 0.0, 2.93, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 207, 10142, "マコト", "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", 1, 24, 207, 3, 0.0, 9.3, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 208, 10142, "マコト", "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", 1, 24, 208, 4, 0.0, 6.9, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 209, 10142, "マコト", "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", 2, 24, 209, 2, 0.0, 0.0, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 210, 10142, "マコト", "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", 2, 24, 210, 1, 0.0, 5.95, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 211, 10142, "マコト", "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", 1, 24, 211, 2, 0.0, 6.73, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 212, 10142, "マコト", "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", 2, 24, 212, 2, 0.0, 0.0, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 213, 10142, "マコト", "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", 2, 24, 213, 1, 0.0, 6.65, "2024/03/31 12:00:00");
INSERT INTO `v1_4b3ee6df46443df31f545e871d056256a02d93e57a36db2d3d654f90560601df` VALUES ("2030/12/17 14:59:59", 129801, 0.0, 214, 10142, "マコト", "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", 1, 24, 214, 6, 0.0, 3.05, "2024/03/31 12:00:00");
